Superset 1
*12 pushups
*10 walkouts 
3 rounds with 1min 30sec rest between rounds

Superset 2
*10 commando per side
*20 shoulder taps per side
3 rounds with 1min 30 sec rest between rounds 

Finisher
*3x15 superman rows

